import React from "react";

export default function Category({ color, icon, name }) {
  return (
    <div className="category">
      <div className="category-sphere" style={{ backgroundColor: color }}>
        {icon}
      </div>
      <div className="category-name">{name}</div>
    </div>
  );
}
